import { Injectable } from '@angular/core';
import { CustomLoadingService } from './custom-loading.service';
import { DataUtilityService } from './data-utility.service';
import { FrameRequestsService } from './frame-requests.service';
import { HelperFunctionService } from './helper-function.service';
import { RestServiceService } from './rest-service.service';
import { CustomAlertService } from './custom-alert.service';
import { CustomToastService } from './custom-toast.service';

@Injectable({
  providedIn: 'root'
})
export class DocumentHandlerService {
  consentFormList = [{ docDescription: 'CONSENT FORM', docType: 'CONSENT' }];

  constructor(public customLoading: CustomLoadingService, public dataUtility: DataUtilityService,
    public frameRequest: FrameRequestsService, public helperFn: HelperFunctionService,
    public restService: RestServiceService, public customAlert: CustomAlertService,
    public customToast: CustomToastService,
  ) { }

  async callSaveConsentForm() {
    try {
      this.customLoading.presentLoading('Uploading consent form...');
      // let document = { data: this.dataUtility.getConsentForm(), type: 'IMG' };
      let document = {
        "data": "",
        "type": "IMG"
      }
      let request = await this.frameRequest.frameDocumentUploadRequest(
        'UPLOAD',
        document,
        this.consentFormList[0],
        this.helperFn.getDocumentId().businessDocument,
      );
      let response: any = await this.restService.restApiCall(
        this.helperFn.getServiceNames().Mobdocupload,
        request,
      );
      if (response.errorCode == this.helperFn.errorCodes().ErrorCode) {
        this.customLoading.dismissLoading();
        this.customToast.presentToast(
          'Consent form uploaded successfully',
          'checkmark-circle',
          'bottom',
        );
        return true;
      } else {
        this.customLoading.dismissLoading();
        this.customAlert.presentCustomAlert(
          response.errorDesc,
          this.customAlert.warningAlert(),
        );
        return false;
      }
    } catch (error) {
      this.customLoading.dismissLoading();
      console.log(error, 'PersonalDetailsPage-saveConsentForm');
      return false;
    }
  }
}
